import './App.css';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Dashboard from './admin/Dashboard';
import Appointment from './components/Appointment';
import VisitorDashboard from './components/appointment/VisitorDashboard';
import Signup from './components/Signup';
import Home from './components/Home';
import Login from './components/Login';

function App() {
  // Your authentication logic here
  const isAuthenticated = /* Check if user is authenticated */ true;

  const PrivateRoute = ({ element, path }) => {
    return isAuthenticated ? (
      <Route path={path} element={element} />
    ) : (
      <Navigate to="/login" replace />
    );
  };

  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/registration" element={<Signup />} />

          {/* Use PrivateRoute for protected routes */}
        </Routes>
        <Routes>
        <Route path="/appointment" element={<PrivateRoute/>} />
          <Route path="/dashboard" element={<PrivateRoute element={<VisitorDashboard />} />} />
          <Route path="/admin-dashboard" element={<PrivateRoute element={<Dashboard />} />} />
        </Routes>

      </Router>
    </div>
  );
}

export default App;
